import { services } from '.';

export default () => {
  const statistic = async (page = 1, q) => {
    try {
        const response = await services.get('statistics', {
            params: {
                page: page,
                search: q
            }
        })
        return response
    } catch (e) {
        throw e
    }
  };
  return {
    statistic
  }
};
